window.bookSummaryJSON = "<p>He thought his final assignment would be simple: Transport a package from Japan to Amsterdam. But for Orlando's mentor, Abraham, the job was not at all like he expected and ended up haunting him. Seven years later, Quinn and Orlando know something is up when Abraham asks for a favor. At his age, he should be sitting on a beach, enjoying his retirement, not working. After he tells them of his search for the last package he ever delivered, they help him unravel the truth, but soon realize they can't simply look for answers. They must also protect the package, no matter the cost. They just need to find it first.</p>"; 
